import { Link, NavLink } from "react-router-dom";

const Header = () => {
  return (
    <header>
      <h1>Movie App</h1>
      <ul>
        <li>
          <NavLink to="/" end>
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to="suggest-movie">suggest movie</NavLink>
        </li>
      </ul>
    </header>
  );
};

export default Header;
